/**
 * Icon Pack - Beautiful, weight-adjustable SVG icons
 * 
 * @packageDocumentation
 * @module @moamfar/icon-pack
 * 
 * @example
 * ```tsx
 * import { Heart, Star, User } from '@moamfar/icon-pack';
 * 
 * function App() {
 *   return (
 *     <div>
 *       <Heart size={32} color="red" />
 *       <Star size={24} color="gold" weight="bold" />
 *       <User size={48} color="#4f46e5" weight="linear" />
 *     </div>
 *   );
 * }
 * ```
 */

import * as React from "react";

/**
 * Props for all icons in @moamfar/icon-pack
 * 
 * @example Basic usage
 * ```tsx
 * <IconName size={32} color="red" weight="bold" />
 * ```
 * 
 * @example With Tailwind CSS
 * ```tsx
 * <IconName className="text-blue-500 hover:text-blue-700" />
 * ```
 * 
 * @example Inline styling
 * ```tsx
 * <IconName style={{ margin: '10px', opacity: 0.8 }} />
 * ```
 */
export interface IconProps extends React.SVGProps<SVGSVGElement> {
  /** 
   * Size of the icon in pixels
   * @default 24
   * @example 32
   */
  size?: number;
  
  /** 
   * Color of the icon. Can be any valid CSS color.
   * @default "currentColor"
   * @example "red", "#FF0000", "rgb(255, 0, 0)"
   */
  color?: string;
  
  /** 
   * Style variant of the icon
   * @default "outline"
   * @example "bold", "linear", "boldduotone"
   */
  weight?: "broken" | "fill" | "outline";
  
  /** 
   * CSS class name for additional styling
   * @example "text-red-500 hover:text-red-700"
   */
  className?: string;
  
  /** 
   * Inline styles for the icon
   * @example {{ margin: '10px' }}
   */
  style?: React.CSSProperties;
  
  /** 
   * Click handler
   * @example () => console.log('Icon clicked')
   */
  onClick?: React.MouseEventHandler<SVGSVGElement>;
}

